import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function DogList() {
  // Assuming dogsData is an array of dog objects fetched from an API
  const [dogsData, setDogsData] = useState([]);

  useEffect(() => {
    // Fetch dogs data from an API
    // Example API call:
    fetch('https://dogapi.dog/api/v2/')
      .then(response => response.json())
      .then(data => setDogsData(data))
      .catch(error => console.error('Error fetching dogs data:', error));
  }, []);

  return (
    <div>
      <h1>Dog List</h1>
      <ul>
        {dogsData.map(dog => (
          <li key={dog.id}>
            <Link to={`/dogs/${dog.id}`}>{dog.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DogList;
